%python

def shortenLog(activityLog):
    shortLog = activityLog
    shortLog['keep'] = shortLog['activity'] != shortLog.shift()['activity']
    shortLog.iloc[0]['keep'] = False
    shortLog =  shortLog[shortLog['keep'] == True]

    return shortLog

# finds a sequence within a timeframe
def findSequenceTimeframe(searchedSequence, observedSequence):
    searchedSequenceIndex = 0
    startDate = 0
    for (date, row) in observedSequence.iterrows():
        print row['activity']
        if row['activity'] == searchedSequence[searchedSequenceIndex]:
            if searchedSequenceIndex == 0:
                startDate = date
            searchedSequenceIndex = searchedSequenceIndex + 1

        else:
            if row['activity'] != '':
                searchedSequenceIndex = 0

        if searchedSequenceIndex == len(searchedSequence):
            return (startDate, date)

    return (0,0)
